import React from "react";

const BlogCard = ({ item: { id, date, catgeory, title, cover, para, desc } }) => {
  return;
  <>
    <div className="items">
      <div className="img">
        <img src={cover} />
      </div>
    </div>
  </>;
};

export default BlogCard;
